import React, { useState, useEffect } from "react";
import { getSingleProduct } from "../services/productService";

import ProductBanner from "../components/ShowProduct/ProductBanner";
import Summary from "../components/ShowProduct/Summary";
import Features from "../components/ShowProduct/Features";
import Reasons from "../components/ShowProduct/Reasons";
import CallToAction from "../components/ShowProduct/CallToAction";

const ShowProduct = () => {
  const [product, setProduct] = useState({});

  const id = "66230e93862e1249483e6c43";

  useEffect(() => {
    const getData = async () => {
      try {
        const productData = await getSingleProduct(id);
        setProduct(productData);
      } catch (error) {
        console.log("Error fetching data:", error);
      }
    };

    getData();
  }, []);

  return (
    <div className="">
      <ProductBanner />

      <Summary />

      <Features />

      {/* FEATURE COMPONENT */}
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 p-4 py-10">
      <h2 className="text-2xl font-bold mb-4">Features</h2>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-10 text-center">

        <div>
          <h3>Feature 1</h3>
          <p>feature description</p>
        </div>
        <div>
          <h3>Feature 2</h3>
          <p>feature description</p>
        </div>
        <div>
          <h3>Feature 3</h3>
          <p>feature description</p>
        </div>
        <div>
          <h3>Feature 4</h3>
          <p>feature description</p>
        </div>
        <div>
          <h3>Feature 5</h3>
          <p>feature description</p>
        </div>
        <div>
          <h3>Feature 6</h3>
          <p>feature description</p>
        </div>
      </div>
      </div>

      {/* REASONS COMPONENT */}
      <div>
        <div>
          <h2>Why Use This Product?</h2>
        </div>
        <div>
          <div>
            <h3>Reason 1</h3>
            <p>reason description</p>
          </div>
          <div>
            <h3>Reason 2</h3>
            <p>reason description</p>
          </div>
          <div>
            <h3>Reason 3</h3>
            <p>reason description</p>
          </div>
          <div>
            <h3>Reason 4</h3>
            <p>reason description</p>
          </div>
        </div>
      </div>

      {/* CALLTOACTION COMPONENT */}
      <div>
        <h2>so what are you waitning for?</h2>
        <p>Click the button below to download experience this awesome product</p>
        <button>DOWNLOAD</button>
      </div>

      {/*  */}
      <div></div>
    </div>
  );
};

export default ShowProduct;
